import Footer_menu from '../component/footer_menu';

const Home = () => {
  return (
      <div className="root-home">
        <Menu />
        <body>
          <div width="100%">
            {/* <Banner /> */}
          </div>
          <BudgetAnalyzer/>
          <Category />
          {/* <Show_Place_Province /> */}
          <Footer_menu />
        </body>
      </div>
  );
};

export default Home;
